import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'
import { AboutUs, Footer, Header, Intro, SpecialMenu } from './container';
import { Navbar } from './components';
import BookTable from './pages/BookTable/BookTable.jsx';
import './App.css';

const App = () => (
  <Router>
    <Routes>
      <Navbar />
      <Header />
      <AboutUs />
      <SpecialMenu />
      <Footer />
      <Route exact path="/booktable" element={<BookTable />} /> {/* Define route for BookTable component */}
    </Routes>
  </Router>
);

export default App;
